import React from 'react';
import './map.css';
import { Loader } from "@googlemaps/js-api-loader"

let map;
const API_KEY = "AIzaSyBp3yj-pQJb3wB9RfdJ4VTKkjMhvDPxuBg";
const callback = "initMap";
const endpoint = "https://maps.googleapis.com/maps/api/js";
const call = endpoint+"?key="+API_KEY+"&callback="+callback;

export default class Map extends React.Component{



    initMap = () => {
        map = new google.maps.Map(document.getElementById("map"), {
            center: { lat: 48.851913, lng: 2.286672 },//Centered on ECE Paris
            zoom: 20,
        });
    }

    render(){
        return(
            <body>
                <div id="map"></div>
                <script src={call} async ></script>
            </body>
        );
    }
}
